import React from "react";
import "../css/loginSelection.css";
import student from "../images/student.jpg";
import staff from "../images/staff.jpg";
import teacher from "../images/teacher.jpg";
import admin from "../images/admin.jpg";

function loginSelection() {
  return (
    <div class="card-group card-group1">

      <div class="card card-1">
        <img src={student} class="card-img-top" alt="..." />
        <div class="card-body">
          <a href=""/><h5 class="card-title">Login as Student</h5><a/>
        </div>
      </div>
      
      <div class="card card-1">
        <img src={teacher} class="card-img-top" alt="..." />
        <div class="card-body">
          <h5 class="card-title">Login as Teacher</h5>
        </div>
      </div>

      <div class="card card-1">
        <img src={staff} class="card-img-top" alt="..." />
        <div class="card-body">
          <h5 class="card-title">Login as Staff</h5>         
        </div>
      </div>

      <div class="card card-1">
        <img src={admin} class="card-img-top" alt="..." />
        <div class="card-body">
          <h5 class="card-title">Login as Administrator</h5>         
        </div>
      </div>

    </div>
  );
}

export default loginSelection;
